{
  "translationLines": [
    {
      "lineNumber": 75741,
      "originalJapaneseLine": "窓の外から届く戦場の音も遠くに。",
      "translatedEnglishLine": "The sounds of the battlefield coming from outside the window were distant."
    },
    {
      "lineNumber": 75742,
      "originalJapaneseLine": "お互いの心音だけを耳にして、",
      "translatedEnglishLine": "Only hearing each other's heartbeats,"
    },
    {
      "lineNumber": 75743,
      "originalJapaneseLine": "二人はそっと眠りについた。",
      "translatedEnglishLine": "The two of them quietly fell asleep."
    },
    {
      "lineNumber": 75744,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 75745,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 75746,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 75747,
      "originalJapaneseLine": "「あら？　リア様？",
      "translatedEnglishLine": "\"Oh? Lady Ria?"
    },
    {
      "lineNumber": 75748,
      "originalJapaneseLine": "　こんな場所でどうかされましたか？」",
      "translatedEnglishLine": "Is something the matter in a place like this?\""
    },
    {
      "lineNumber": 75749,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 75750,
      "originalJapaneseLine": "「え、あ、あの……？」",
      "translatedEnglishLine": "\"Uh, um, well...?"
    },
    {
      "lineNumber": 75751,
      "originalJapaneseLine": "「べっつにー」",
      "translatedEnglishLine": "\"N-not really—\""
    },
    {
      "lineNumber": 75752,
      "originalJapaneseLine": "「どーせっ、最後に笑うのはリアなんだから」",
      "translatedEnglishLine": "\"Anyway, in the end, it’s Ria who laughs last.\""
    },
    {
      "lineNumber": 75753,
      "originalJapaneseLine": "「ふんっ」",
      "translatedEnglishLine": "\"Hmph.\""
    },
    {
      "lineNumber": 75754,
      "originalJapaneseLine": "「？」",
      "translatedEnglishLine": "\"?\""
    },
    {
      "lineNumber": 75755,
      "originalJapaneseLine": "「よーし、また出るぞ。",
      "translatedEnglishLine": "\"Alright, we’re heading out again."
    },
    {
      "lineNumber": 75756,
      "originalJapaneseLine": "　お前ら準備はいいだろうな」",
      "translatedEnglishLine": "You guys ready?\""
    },
    {
      "lineNumber": 75757,
      "originalJapaneseLine": "「は、はい、頑張りましょう」",
      "translatedEnglishLine": "\"Y-yes, let’s do our best.\""
    },
    {
      "lineNumber": 75758,
      "originalJapaneseLine": "そのとき、空からメガワスと",
      "translatedEnglishLine": "At that moment, Megawas and"
    },
    {
      "lineNumber": 75759,
      "originalJapaneseLine": "かなみのコンビが降りてきた。",
      "translatedEnglishLine": "the pair Kanami descended from the sky."
    },
    {
      "lineNumber": 75760,
      "originalJapaneseLine": "「またまた見てきたわよー。ﾇﾇﾇ」",
      "translatedEnglishLine": "\"We’ve come back to report again. Nunu.\""
    },
    {
      "lineNumber": 75761,
      "originalJapaneseLine": "「よいっしょ、と」",
      "translatedEnglishLine": "\"Alright, here we go.\""
    },
    {
      "lineNumber": 75762,
      "originalJapaneseLine": "「よし、早速報告するのだ」",
      "translatedEnglishLine": "\"Alright, report quickly.\""
    },
    {
      "lineNumber": 75763,
      "originalJapaneseLine": "「ええ、ここから近い地点にいる魔物将軍は、",
      "translatedEnglishLine": "\"Yes, the monster general near this location is"
    },
    {
      "lineNumber": 75764,
      "originalJapaneseLine": "　09地点に展開している魔軍の……」",
      "translatedEnglishLine": "a part of the demon army deployed at point 09...\""
    },
    {
      "lineNumber": 75765,
      "originalJapaneseLine": "「む、待て……」",
      "translatedEnglishLine": "\"W-wait...\""
    },
    {
      "lineNumber": 75766,
      "originalJapaneseLine": "「え？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 75767,
      "originalJapaneseLine": "「はぁ、はあ……よ、良かった……",
      "translatedEnglishLine": "\"Hah, hah... th-that’s a relief..."
    },
    {
      "lineNumber": 75768,
      "originalJapaneseLine": "　まだ皆さん出発はしていなかったようですね」",
      "translatedEnglishLine": "Looks like no one has left yet.\""
    },
    {
      "lineNumber": 75769,
      "originalJapaneseLine": "「ウルザさん！　どうしたんですか！？」",
      "translatedEnglishLine": "\"Ulza! What’s wrong!?\""
    },
    {
      "lineNumber": 75770,
      "originalJapaneseLine": "指揮官として正面山道で戦っている筈の",
      "translatedEnglishLine": "Ulza, who was supposed to be fighting as the commander on the front mountain path,"
    },
    {
      "lineNumber": 75771,
      "originalJapaneseLine": "ウルザが山道を上り現れた。",
      "translatedEnglishLine": "appeared climbing up the mountain path."
    },
    {
      "lineNumber": 75772,
      "originalJapaneseLine": "「ん……ふぅ……」",
      "translatedEnglishLine": "\"Nn... phew...\""
    },
    {
      "lineNumber": 75773,
      "originalJapaneseLine": "一息で呼吸を整えると、",
      "translatedEnglishLine": "After a deep breath to steady herself,"
    },
    {
      "lineNumber": 75774,
      "originalJapaneseLine": "ウルザはランスに向き直る。",
      "translatedEnglishLine": "Ulza turned to Rance."
    },
    {
      "lineNumber": 75775,
      "originalJapaneseLine": "「正面山道に現れました」",
      "translatedEnglishLine": "\"It appeared on the front mountain path.\""
    },
    {
      "lineNumber": 75776,
      "originalJapaneseLine": "「魔人――レッドアイです」",
      "translatedEnglishLine": "\"The demon—Red Eye.\""
    },
    {
      "lineNumber": 75777,
      "originalJapaneseLine": "「おお、ついに来たか！」",
      "translatedEnglishLine": "\"Oh, it’s finally here!\""
    },
    {
      "lineNumber": 75778,
      "originalJapaneseLine": "「なんとか正面で戦っていますが……",
      "translatedEnglishLine": "\"We’re somehow fighting it head-on, but..."
    },
    {
      "lineNumber": 75779,
      "originalJapaneseLine": "　やはりとんでもない強さです」",
      "translatedEnglishLine": "It’s incredibly strong after all.\""
    },
    {
      "lineNumber": 75780,
      "originalJapaneseLine": "「現在、魔人レッドアイは、",
      "translatedEnglishLine": "\"Currently, the demon Red Eye"
    },
    {
      "lineNumber": 75781,
      "originalJapaneseLine": "　無人の野を進むが如く、",
      "translatedEnglishLine": "advances across the empty plains as if no one is there,"
    },
    {
      "lineNumber": 75782,
      "originalJapaneseLine": "　一歩一歩このランス城に向かっています」",
      "translatedEnglishLine": "step by step toward this castle of Rance.\""
    },
    {
      "lineNumber": 75783,
      "originalJapaneseLine": "「ふん、あの寄生魔人は既に撃退済み。",
      "translatedEnglishLine": "\"Hmph, that parasitic demon has already been defeated."
    },
    {
      "lineNumber": 75784,
      "originalJapaneseLine": "　今度は逃さずブッ殺すだけだ」",
      "translatedEnglishLine": "This time, we just have to kill it without letting it escape.\""
    },
    {
      "lineNumber": 75785,
      "originalJapaneseLine": "「そしたら魔軍も驚いて逃げ出すに違いない。",
      "translatedEnglishLine": "\"Then the demon army will surely be shocked and flee."
    },
    {
      "lineNumber": 75786,
      "originalJapaneseLine": "　そうだな、ウルザちゃん」",
      "translatedEnglishLine": "Right, Ulza-chan?\""
    },
    {
      "lineNumber": 75787,
      "originalJapaneseLine": "「……え、ええ。",
      "translatedEnglishLine": "\"...Y-yes."
    },
    {
      "lineNumber": 75788,
      "originalJapaneseLine": "　そうなる可能性は……あります」",
      "translatedEnglishLine": "There is a possibility that will happen.\""
    },
    {
      "lineNumber": 75789,
      "originalJapaneseLine": "「魔人の登場が光明に見えるとはな……",
      "translatedEnglishLine": "\"To think the demon’s appearance would seem like a beacon of hope..."
    },
    {
      "lineNumber": 75790,
      "originalJapaneseLine": "　まったく、とんでもない話だぜ……」",
      "translatedEnglishLine": "Truly, it’s an outrageous story...\""
    }
  ]
}

